    false,nt"url": null,nt"notes": "The Flood Insurance Rate Map (FIRM) Database
    depicts flood risk information and supporting data used to develop the risk data.
    The primary risk classifications used are the 1-percent-annual-chance flood event,
    the 0.2-percent-annual-chance flood event, and areas of minimal flood risk. The
    FIRM Database is derived from Flood Insurance Studies (FISs), previously published
    FIRMs, flood hazard analyses performed in support of the FISs and FIRMs, and new
    mapping data, where available. The FISs and FIRMs are published by the Federal Emergency
    Management Agency (FEMA). This file is georeferenced to the Earth's surface using
    the Geographic Coordinate System (GCS) and North American Datum of 1983 (NSRS-2007).",nt"license_title":
